css:
section,
.section {
  position: relative;
  margin-top: 0;
}
section:last-child,
.section:last-child {
  margin-bottom: 0;
}
section.bordered,
.section.bordered {
  margin: 0;
  padding: 20px 0;
  border-top: 1px solid rgba(140, 115, 115, 0.12);
  border-bottom: 1px solid #e6e6e6;
}
section .section-heading:first-child,
.section .section-heading:first-child {
  margin-top: 0;
  font-weight: bold;
  color: #5c3d3d;
}
div > section:first-child,
form > section:first-child,
div > .section:first-child,
form > .section:first-child {
  border-top: none;
  padding-top: 0;
}
div > section:last-child,
form > section:last-child,
div > .section:last-child,
form > .section:last-child {
  border-bottom: none;
  padding-bottom: 0;
}
